import React from 'react';
import { PdfViewer } from 'react-pdf-viewer';
import { Button } from '@material-ui/core';

export default function Resume() {
    return (

    <><PdfViewer
            url="https://drive.google.com/file/d/1_dsdZGIvo31_pwRLeOhLSeb"
            download="true" />
            <Button
                variant="contained"
                color="primary"
                onClick={() => window.location.href = 'https://drive.google.com/file/d/1_dsdZGIvo31_pwRLeOhLSeb'}
            >
                Download PDF
            </Button></>
    );
}
